type Day01 struct{}

func (d Day01) SolvePart1() int {
	floor := 0
	for i := 0; i < len(txt); i++ {
		if txt[i] == '(' {
			floor++
		} else if txt[i] == ')' {
			floor--
		}
	}

	return floor
}

func (d Day01) SolvePart2() int {
	floor := 0
	position := 0
	for i := 0; i < len(txt); i++ {
		if txt[i] == '(' {
			floor++
		} else if txt[i] == ')' {
			floor--
		}
		if floor == -1 {
			position = i
			break
		}
	}

	return position + 1
}

func (d Day01) GetName() string {
	return "Day 01"
}
